INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 1, 0.0, 10.85, 10142, 0.0, 7, "2030/12/17 14:59:59", 24, 100, 100, 129901, "エリコ", "訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 1, 0.0, 11.15, 10142, 0.0, 2, "2030/12/17 14:59:59", 24, 101, 101, 129901, "エリコ", "厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 7, 0.0, 6.4, 10142, 0.0, 5, "2030/12/17 14:59:59", 24, 102, 102, 129901, "エリコ", "行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 3, 0.0, 0.0, 10142, 0.0, 3, "2030/12/17 14:59:59", 24, 103, 103, 129901, "エリコ", "まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 2, 0.0, 2.43, 10142, 0.0, 8, "2030/12/17 14:59:59", 24, 104, 104, 129901, "エリコ", "クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 4, 0.0, 9.08, 10142, 0.0, 3, "2030/12/17 14:59:59", 24, 105, 105, 129901, "エリコ", "私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 6, 0.0, 0.0, 10142, 0.0, 6, "2030/12/17 14:59:59", 24, 106, 106, 129901, "エリコ", "まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 3, 0.0, 10.6, 10142, 0.0, 8, "2030/12/17 14:59:59", 24, 107, 107, 129901, "エリコ", "私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 6, 0.0, 7.54, 10142, 0.0, 4, "2030/12/17 14:59:59", 24, 108, 108, 129901, "エリコ", "ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 2, 0.0, 11.5, 10142, 0.0, 7, "2030/12/17 14:59:59", 24, 109, 109, 129901, "エリコ", "なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 2, 0.0, 8.83, 10142, 0.0, 1, "2030/12/17 14:59:59", 24, 110, 110, 129901, "エリコ", "これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 1, 0.0, 6.68, 10142, 0.0, 2, "2030/12/17 14:59:59", 24, 111, 111, 129901, "エリコ", "未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 6, 0.0, 8.8, 10142, 0.0, 2, "2030/12/17 14:59:59", 24, 112, 112, 129901, "エリコ", "まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 2, 0.0, 8.9, 10142, 0.0, 1, "2030/12/17 14:59:59", 24, 113, 113, 129901, "エリコ", "クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 2, 0.0, 3.7, 10142, 0.0, 5, "2030/12/17 14:59:59", 24, 114, 114, 129901, "エリコ", "なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 1, 0.0, 7.6, 10142, 0.0, 2, "2030/12/17 14:59:59", 24, 200, 200, 129801, "マコト", "よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 2, 0.0, 2.25, 10142, 0.0, 1, "2030/12/17 14:59:59", 24, 201, 201, 129801, "マコト", "ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 2, 0.0, 3.28, 10142, 0.0, 1, "2030/12/17 14:59:59", 24, 202, 202, 129801, "マコト", "行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 4, 0.0, 2.98, 10142, 0.0, 1, "2030/12/17 14:59:59", 24, 203, 203, 129801, "マコト", "みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 4, 0.0, 3.0, 10142, 0.0, 1, "2030/12/17 14:59:59", 24, 204, 204, 129801, "マコト", "こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 1, 0.0, 10.3, 10142, 0.0, 2, "2030/12/17 14:59:59", 24, 205, 205, 129801, "マコト", "おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 6, 0.0, 2.93, 10142, 0.0, 1, "2030/12/17 14:59:59", 24, 206, 206, 129801, "マコト", "これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 3, 0.0, 9.3, 10142, 0.0, 1, "2030/12/17 14:59:59", 24, 207, 207, 129801, "マコト", "おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 4, 0.0, 6.9, 10142, 0.0, 1, "2030/12/17 14:59:59", 24, 208, 208, 129801, "マコト", "まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 2, 0.0, 0.0, 10142, 0.0, 2, "2030/12/17 14:59:59", 24, 209, 209, 129801, "マコト", "ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 1, 0.0, 5.95, 10142, 0.0, 2, "2030/12/17 14:59:59", 24, 210, 210, 129801, "マコト", "なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 2, 0.0, 6.73, 10142, 0.0, 1, "2030/12/17 14:59:59", 24, 211, 211, 129801, "マコト", "今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 2, 0.0, 0.0, 10142, 0.0, 2, "2030/12/17 14:59:59", 24, 212, 212, 129801, "マコト", "おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 1, 0.0, 6.65, 10142, 0.0, 2, "2030/12/17 14:59:59", 24, 213, 213, 129801, "マコト", "敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ");
INSERT INTO `v1_cc60575afb64598dc5860f79c68a63320ff96f462810250e2b31fe49ba9e536e` VALUES ("2024/03/31 12:00:00", 6, 0.0, 3.05, 10142, 0.0, 1, "2030/12/17 14:59:59", 24, 214, 214, 129801, "マコト", "あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！");
